import { ɵparseCookieValue } from '@angular/common';
import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root',
})
export class JwtService {
  getToken(): string | null {
    return ɵparseCookieValue.getItem('jwt');
  }
}
